INSERT INTO `offre` VALUES (38,'Le B. Retail Park',428,0,'A LOUER, en exclusivité, sur la commune de Le Barp, Local d\'une surface de 428 m2\r\nA proximité des supermarchés SUPER U et LEADER PRICE, les enseignes qui seront présentes : WELDOM, ORANGE BLEU, MIDAS, GENERATION PISCINE,........\r\nDisponible immédiatement, loyer annuel 48 900 € HT, LOT 2, Bail 3-6-9\r\nHonoraires: 30 % HT','',4075,'oui','oui'),(64,'Le B. Retail Park',331,0,'A LOUER, en exclusivité, sur la commune de Le Barp, Local d\'une surface de 331 m2\r\nA proximité des supermarchés SUPER U et LEADER PRICE, les enseignes qui seront présentes : WELDOM, ORANGE BLEU, MIDAS, GENERATION PISCINE,........\r\nDisponible immédiatement, loyer annuel 33 100 € HT, LOT 5, Bail 3-6-9\r\nHonoraires: 30 % HT','',2750,'oui','oui'),(78,'VILLA MERIGNAC',120,0,'A vendre à Mérignac, quartier résidentiel, proche accès rocade, villa T5, comprenant au rdc, un grand séjour, cuisine, cellier, WC.\r\nA l\'étage, 3 chambres, une suite parentale avec douche italienne, une salle de bains familiale, WC.\r\nGarage et jardin clos.\r\nLes travaux ont démarré, livraison fin du premier trimestre 2022.','',496000,'oui','oui'),(79,'Local commercial',100,0,'Situé à Libourne (33), sur un axe très passant nous vous proposons un ensemble commercial d\'une surface de 300 m2 au sol, disposant de 12 places de parking, divisible en 3 lots.\r\nLOT A : 100 m2, loyer mensuel 1950 € HT\r\nHonoraires 30 % HT sur loyer annuel','/Pr_sentation_Locaux_commerciaux_-79.pdf',1950,'oui','oui'),(80,'Ensemble immobilier résidentiel',423,0,'Ensemble immobilier situé à LIBOURNE quartier de la Gare, comprenant 17 logements de type \" studio \".\r\nIdéal investisseurs ou première acquisition.\r\nVENTE en VEFA\r\nAppartement à partir de 80 000 €\r\nDossier sur demande.\r\n\r\n','/Capture_d_cran_2022_06_09_14..41-80.png',80000,'oui','oui'),(81,'LOCAL COMMERCIAL',100,0,'Situé à Libourne (33), sur un axe très passant nous vous proposons un ensemble commercial d\'une surface de 300 m2 au sol, disposant de 12 places de parking, divisible en 3 lots.\r\nLOT B : 100 m2, loyer mensuel 1950 € HT\r\nHonoraires 30 % HT sur loyer annuel','/Pr_sentation_Locaux_commerciaux_-81.pdf',1950,'oui','oui'),(82,'LOCAL COMMERCIAL',100,0,'Situé à Libourne (33), sur un axe très passant nous vous proposons un ensemble commercial d\'une surface de 300 m2 au sol, disposant de 12 places de parking, divisible en 3 lots.\r\nLOT C : 100 m2, loyer mensuel 2150 € HT\r\nHonoraires 30 % HT sur loyer annuel','/Pr_sentation_Locaux_commerciaux_-82.pdf',2150,'oui','oui');
